  \"2013-03-19T00:29:26.296846\",\n\t\"name\": \"high-resolution-lidar-data-for-infrastructure-corridors-fairbanks-quadrangle-alaska3932e\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"In advance of design, permitting, and construction
  of a pipeline to deliver North Slope natural gas to out-of-state customers and Alaska
  communities, the Division of Geological & Geophysical Surveys (DGGS) has acquired
  lidar (light detection and ranging) data along proposed pipeline routes, nearby
  areas of infrastructure, and regions where significant geologic hazards have been
  identified. Lidar data will serve multiple purposes, but have primarily been collected
  to (1) evaluate active faulting, slope instability, thaw settlement, erosion, and
  other engineering constraints along proposed pipeline routes, and (2) provide a
  base layer for the state-federal GIS database that will be used to evaluate permit
  applications and construction plans. The normalized digital surface models (nDSM)
  represent the above ground elevation of the highest laser return with all vegetation
  included.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"responsible-party\",\n\t\t\"value\":
